import { render } from "react-dom";
import './banner-vescis.css';
import Carousel from "./banner-componente";
import BlackDrops from './banner-blackdrops.png';
import HampartePlayers from './banner-hamparteplayers.png';
import Jurisconsulta from './banner-jurisconsulta.png';
import Neomito from './banner-neomito.png';
import Talgidi from './banner-talgidi.png';
import Vescis from './banner-vescis.png';

function Carrusel() {
	return(
		<carrusel component="ul" className="banner-cabecera">
			<li><img src={BlackDrops} className="banner-vescis" alt="banner-vescis" /></li>
			<li><img src={HampartePlayers} className="banner-vescis" alt="banner-vescis" /></li>
			<li><img src={Jurisconsulta} className="banner-vescis" alt="banner-vescis" /></li>
			<li><img src={Neomito} className="banner-vescis" alt="banner-vescis" /></li>
			<li><img src={Talgidi} className="banner-vescis" alt="banner-vescis" /></li>
			<li><img src={Vescis} className="banner-vescis" alt="banner-vescis" /></li>
		</carrusel>
	)
}
export default Carrusel;
//render(<Carrusel />, document.getElementById("root"));
